@DanielWatt Thank you for your politeness as well! I’m not sure I understand all of your points, but I do agree that putting out everyone’s fire equally is important! But in my opinion, given the racism I see in America, some people’s fires are bigger than others! 

I understand the anger against identity politics - I think it’s harmful in a lot of ways too. But I think it’s also essential in recognizing that some people are treated differently, and their houses are on fire right now. I want to support them. And I also want to support your fires too! Maybe those aren’t mutually exclusive.

I know we’re going far with metaphors here - bare with me - but another one I saw that spoke to me is: when you sing happy birthday to someone, do you say “well I think EVERYONE should have a happy birthday!” To me, that’s nonsense. I think the difference we’re talking about here is equality vs equity. Treating everyone equally doesn’t mean everyone gets what they deserve. Let me know what you think?

